import React from 'react';
import ResponsiveNavBar from "../Partials/Header"
import SearchForm from '../utils/SearchForm';



function Ride() {
  return (
    <div className="flex flex-col min-h-screen overflow-hidden">

      {/*  Site header */}
      <ResponsiveNavBar />

      {/*  Page content */}
      <main className="flex py-2 px-8 justify-center align-center bg-teal-500 text-white drop-shadow-xl">

        <SearchForm />
     </main>

      {/*  Site footer */}


    </div>
  );
}

export default Ride;
